     // add to her weight.\n            delegate_.weight += sender.weight;\n        }\n    }\n\n    /// Give your vote (including votes delegated to you)\n    /// to proposal `proposals[proposal].name`.\n    function vote(uint proposal) public {\n        Voter storage sender = voters[msg.sender];\n        require(sender.weight != 0, "Has no right to vote");\n        require(!sender.voted, "Already voted.");\n        sender.voted = true;\n        sender.vote = proposal;\n\n        // If `proposal` is out of the range of the array,\n        // this will throw automatically and revert all\n        // changes.\n        proposals[proposal].voteCount += sender.weight;\n    }\n\n    /// @dev Computes the winning proposal taking all\n    /// previous votes into account.\n    function winningProposal() public view\n            returns (uint winningProposal_)\n    {\n        uint winningVoteCount = 0;\n        for (uint p = 0; p < proposals.length; p++) {\n            if (proposals[p].voteCount > winningVoteCount) {\n                winningVoteCount = proposals[p].voteCount;\n                winningProposal_ = p;\n            }\n        }\n    }\n\n    // Calls winningProposal() function to get the index\n    // of the winner contained in the proposals array and then\n    // returns the name of the winner\n    function winnerName() public view\n            returns (bytes32 winnerName_)\n    {\n        winnerName_ = proposals[winningProposal()].name;\n    }\n}'}],Zi=function(e){var t=e.selectControl,n=e.setEditorValue,r=[(0,ln.jsx)("option",{value:on.config.DEMO_CODE,children:"Load Demo Code"},-1)].concat(c(Ji.map((function(e,t){var n=e.name,r=e.code;return(0,ln.jsx)("option",{value:r,children:n},t)}))));return(0,ln.jsx)("select",{className:"form-select form-select-sm",value:t.selectValue,onChange:function(e){var r=e.target.value;n({code:r}),t.setSelectValue(r)},children:r})},el=function(e){var t=e.setEditorValue;return(0,ln.jsx)("input",{type:"file",accept:".sol",className:"f